import PlayerCard from './components/PlayerCard'
import './App.css';
import data from './'

function App() {
  return (
    <div>

      <Header/>
      <div>
         {data.map(({name , img , statistics})=>(
        <PlayerCard name={name} img={img} statistics={statistics}/>
      ))}
      </div>

    </div>
  );
}

export default App;
